import ImagenesBody from "../Helper/ImagenesBody";
import styles from "./Imagenes.module.css";


const Imagenes = () => {

    return (
        <div className={styles.divcont}>
            {
                ImagenesBody.map((imgSrc, index) => (<img className={`${styles.imgbody} ${styles.animacion}`} src={imgSrc.src} key={index} alt='Imagenes Suca'/>))
            }
        </div>
    )
};

export default Imagenes;
